import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { HttpClient } from '@angular/common/http';

const baseUrl = 'http://localhost:4000/api/MACD';
const baseUrl2 = 'http://localhost:4000/api/EMA50';
const baseUrl3 = 'http://localhost:4000/api/SMA50';

export class MACD {
  Date: string[];
  Scrip: string[];
  Open: number[];
  High: number[];
  Low: number[];
  Close: number[];
  PreClose: number[];
  AdjClose: number[];
  Volume: number[];
  Value: number[];
  Trade: number[];
  Change: number[];
  DateSting: string[];
  DateEpoch: string[];
  MACD: number[];

  constructor() {
    this.Date = [];
    this.Scrip = [];
    this.Open=[];
    this.High=[];
    this.Low=[];
    this.Close=[];
    this.PreClose=[];
    this.AdjClose=[];
    this.Volume=[];
    this.Value=[];
    this.Trade=[];
    this.Change=[];
    this.DateSting=[];
    this.DateEpoch=[];
    this.MACD=[];

  }
}

@Injectable({
  providedIn: 'root'
})
export class TechnicalIndicatorsService {

  constructor(private http: HttpClient) { }

  getMACD(): Observable<any>{
    return this.http.get<any>(baseUrl);
}
  getEMA50(): Observable<any>{
  return this.http.get<any>(baseUrl2);
}
  getSMA50(): Observable<any>{
  return this.http.get<any>(baseUrl3);
}

}
